import logo from './logo.svg';
import './App.css';
import Home from './components/home';
import {BrowserRoute as Router , Route ,Routes} from 'react-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element ={<Home></Home>} />
        </Routes>

      </Router>

    </div>
  );
}

export default App;
